import React from 'react';
import eventcreate from '../apis/eventcreate';

class EventCreate extends React.Component {
	state = {name: null, currency: null, timezone: null, startutc: null, endutc: null};

	handleNameChange(event) {
		this.setState({name: event.target.value});
		console.log(this.state.name);
	}

	handleCurrencyChange(event) {
		this.setState({currency: event.target.value});
	}

	handleTimezoneChange(event) {
		this.setState({timezone: event.target.value});
	}

	handleutcStartChange(event) {
		this.setState({startutc: event.target.value});
	}

	handleutcEndChange(event) {
		this.setState({endutc: event.target.value});
	}

	render() {
		return(
			<div class="ui form error">
				<h3>Create an Event</h3>
				<form>
					<div>
						Event Name: 
						<input type="text" name="name" onChange={this.handleNameChange}/>
					</div>
					<div>
						Currency: 
						<input type="text" currency="currency" onChange={this.handleCurrencyChange} />
					</div>
					<div>
						Timezone: 
						<input type="text" timezone="timezone" onChange={this.handleTimezoneChange}/>
					</div>
					<div>
						Start: 
						<input type="text" startutc="utc" onChange={this.handleutcStartChange} />
					</div>
					<div>
						End: 
						<input type="text" endutc="utc" onChange={this.handleutcEndChange} />
					</div>
					<button className="ui button primary">Submit</button>
				</form>
			</div>
		);
	}
}

export default EventCreate;
